        private HashSet<string> findAllProgramsConnectedToZero(Dictionary<string, List<string>> graph, string key) {
            var visited = new HashSet<string> {key};

            while (true) {
                var next = new HashSet<string>(visited);

                foreach (var n in visited) {
                    foreach (var connector in graph[n]) {
                        next.Add(connector);
                    }
                }

                if (compareSets(next, visited)) {
                    break;
                }

                visited = next;
            }

            return visited;
        }

        public static bool compareSets(HashSet<string> set1, HashSet<string> set2) {
            if (set1.Count != set2.Count) {
                return false;
            }

            var list1 = set1.ToList();
            var list2 = set2.ToList();

            for (var i = 0; i < list1.Count; ++i) {
                if (!list1[i].Equals(list2[i])) {
                    return false;
                }
            }

            return true;
        }
        
        class Comparer : IEqualityComparer<HashSet<string>> {
            public bool Equals(HashSet<string> set1, HashSet<string> set2) {
                if (set1.Count != set2.Count) {
                    return false;
                }
                
                var set1copy = new HashSet<string>(set1);
                var set2copy = new HashSet<string>(set2);

                foreach (var element in set1copy.ToList()) {
                    set1copy.Remove(element);
                    set2copy.Remove(element);

                    if (set1copy.Count != set2copy.Count) {
                        return false;
                    }
                }

                return true;
            }

            public int GetHashCode(HashSet<string> set) {
                var hashcode = 0;

                foreach (var elem in set) {
                    hashcode += elem.GetHashCode();
                }

                return hashcode;
            }
        }
